<H1><A NAME="lnk1169"></A><SUP></SUP>Linker Tools Error LNK1169</H1>

<P class=dt><B>one or more multiply defined symbols found</B></P>

<P>The build failed due to multiple definitions of one or more symbols. This error is preceded by error <A HREF="lnk2005.htm">LNK2005</A>.</P>

<P>The <A HREF="_core_.2f.force.htm">/FORCE</A> or /FORCE:MULTIPLE option overrides this error.</P>
